import React from "react";

interface ListProps<T> {
    tasks: T[]
    renderTask: (task: T) => React.ReactNode
}

export default function List<T>(props: ListProps<T>) {

    return(
        <div>
            {props.tasks.map(props.renderTask)}
        </div>
    )
}
